# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - logging.Logger~Subclass
    - upgrade
    - Member[ast].Member[Logger]
  - - logging.Logger~Subclass
    - upgrade
    - Member[commands].Member[codemods].Member[Logger]
  - - logging.Logger~Subclass
    - upgrade
    - Member[commands].Member[support_sqlalchemy].Member[Logger]
  - - logging.Logger~Subclass
    - upgrade
    - Member[configuration].Member[Logger]
  - - logging.Logger~Subclass
    - upgrade
    - Member[upgrade].Member[Logger]
